<!-- Write an IIFE that prints “JS Loaded Successfully!” when page loads. -->

<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <script>
        (function IIFE(){
            alert("JS Loaded Successfully!")
        })()
        

    </script>
</body>
</html>
